import React, { Component } from 'react';
import axios from 'axios';

export default class Home extends Component{

    constructor(props){
        super(props);
        this.logout=this.logout.bind(this);
    }
    logout(){
        axios.delete('/logout')
            .then(res => window.location="/");
    }
    render(){
        if(this.props.islog==='no'){
            return(
                <div className='container'>
                    <br />
                    <br />
                    <h2 className='mb-2' style={{fontFamily:"Georgia",position:"relative",right:"-330px"}}><b>Automate With Credflow</b></h2>
                    <br />
                    <img width="360" height="360" style={{fontFamily:"Georgia",position:"relative",right:"-300px"}} src="data:image/png;base64," />
                    <br />
                    <a href='http://localhost:5000/register' className='btn btn-primary'>Register</a>
                    <a href='http://localhost:5000/login' className='btn btn-success'>Login</a>
                </div>
            )
        }
        else if(this.props.islog.user_id===1 || this.props.picture){
            return(
                <div className='container'>
                        <br />
                        <br />
                        <h2 className='mb-2' style={{fontFamily:"Georgia",position:"relative",right:"-330px"}}><b>Automate With Credflow</b></h2>
                        <br />
                        <img width="360" height="360" style={{fontFamily:"Georgia",position:"relative",right:"-300px"}} src="data:image/png;base64," />
                        <br />
                        <a href='#' className='btn btn-danger' onClick={this.logout}>Logout</a>
                </div>
            )
        }
        else{
            return(
                <h2 style={{color:"rgba(0,0,0,0)"}}>Hello</h2>
            )
        }
    }
}